const $ = new Env("IT之家");
$.userHash = "senku_ithome_userHash";
const code = [
  0,
  1,
  2,
  3,
  256,
  257,
  258,
  259,
  512,
  513,
  514,
  515,
  768,
  769,
  770,
  771,
];
const now = new Date().getTime();
$.arr = [];
$.result = "";

!(async () => {
  $.CryptoJS = $.isNode() ? require("crypto-js") : CryptoJS;
  //   code.forEach(async (val) => {
  //     await sign(val);
  //   });
  await sign();
  await signinfo();
  await showmsg();
})()
  .catch((e) => $.logErr(e))
  .finally(() => $.done());

function sign() {
  return new Promise((resolve) => {
    const url = {
      url: getUrl(),
      headers: {
        Host: "napi.ithome.com",
        "User-Agent":
          "Mozilla/5.0 (iPhone; CPU iPhone OS 14_4 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Mobile/15E148 ithome/rmsdklevel2/day/7.63",
      },
    };
    $.get(url, (err, resp, data) => {
      try {
        const res = JSON.parse(data);
        if (res.ok === 0) {
          $.result = res.msg;
        } else if (res.ok === 1) {
          $.result = res.title;
        } else {
          $.result = "未知签到结果，请查看日志";
          console.log(data);
        }
      } catch (e) {
        $.logErr(e, resp);
      } finally {
        resolve();
      }
    });
  });
}

function signinfo() {
  return new Promise((resolve) => {
    const userHash = $.getdata($.userHash);
    const url = {
      url: `https://napi.ithome.com/api/usersign/getsigninfo?userHash=${userHash}`,
      headers: {},
    };
    url.headers["User-Agent"] =
      "Mozilla/5.0 (iPhone; CPU iPhone OS 14_0 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Mobile/15E148 ithome/rmsdklevel2/day/7.32";
    $.get(url, (err, resp, data) => {
      try {
        $.signinfo = JSON.parse(data);
      } catch (e) {
        $.logErr(e, resp);
      } finally {
        resolve();
      }
    });
  });
}

function encrypt(str) {
  const key = `HCa%Y|7#`;
  const keyHex = $.CryptoJS.enc.Utf8.parse(key);
  return $.CryptoJS.enc.Base64.parse(
    $.CryptoJS.DES.encrypt(str, keyHex, {
      mode: $.CryptoJS.mode.ECB,
      padding: $.CryptoJS.pad.ZeroPadding,
    }).toString()
  ).toString($.CryptoJS.enc.Hex);
}

function showmsg() {
  return new Promise((resolve) => {
    $.subt = `签到:${$.result}`;
    $.desc = [];
    if ($.signinfo) {
      $.desc.push(
        `连续:${$.signinfo.cdays}天,累计:${$.signinfo.mdays}天,金币:${$.signinfo.totalcoin}个`
      );
    }
    $.msg($.name, $.subt, $.desc.join("\n"));
    resolve();
  });
}

function gekk(S) {
  const Skey =
    "hd7%b4f8p9)*fd4h5l6|)123/*-+!#$@%^*()_+?>?njidfds[]rfbcvnb3rz/ird|opqqyh487874515/%90hggigadfihklhkopjj`b3hsdfdsf84215456fi15451%q(#@Fzd795hn^Ccl$vK^L%#w$^yr%ETvX#0TaPSRm5)OeG)^fQnn6^%^UTtJI#3EZ@p6^Rf$^!O$(jnkOiBjn3#inhOQQ!aTX8R)9O%#o3zCVxo3tLyVorwYwA^$%^b9Yy$opSEAOOlFBsS^5d^HoF%tJ$dx%3)^q^c^$al%b4I)QHq^#^AlcK^KZFYf81#bL$n@$%j^H(%m^";
  const timeStemp = new Date(now).getTime();
  const today = new Date(now).getDate();
  const Value1 = Math.round(timeStemp / 50000) * today * 3;
  if (S === 3) {
    return (
      Skey[parseInt((Value1 % 10000) / 1000) * today] +
      Skey[parseInt((Value1 % 1000) / 100) * today] +
      Skey[parseInt((Value1 % 100) / 10) * today]
    );
  } else if (S === 8) {
    return (
      Skey[parseInt((Value1 % 100000000) / 10000000) * today] +
      Skey[parseInt((Value1 % 10000000) / 1000000) * today] +
      Skey[parseInt((Value1 % 1000000) / 100000) * today] +
      Skey[parseInt((Value1 % 100000) / 10000) * today] +
      Skey[parseInt((Value1 % 10000) / 1000) * today] +
      Skey[parseInt((Value1 % 1000) / 100) * today] +
      Skey[parseInt((Value1 % 100) / 10) * today] +
      Skey[parseInt(Value1 % 10) * today]
    );
  }
}

function gnekk() {
  const base = CryptoJS.TripleDES.encrypt(
    CryptoJS.enc.Utf8.parse(gekk(3)),
    CryptoJS.enc.Utf8.parse(gekk(8)),
    {
      mode: CryptoJS.mode.ECB, // 加密模式
      padding: CryptoJS.pad.ZeroPadding,
    }
  ).toString();
  const text = "k" + CryptoJS.enc.Base64.parse(base).toString(CryptoJS.enc.Hex);
  return text;
}

function geKsk() {
  const base = CryptoJS.TripleDES.encrypt(
    CryptoJS.enc.Utf8.parse($.time("yyyy-MM-dd HH:mm:ss", now)),
    CryptoJS.enc.Utf8.parse(gekk(8)),
    {
      mode: CryptoJS.mode.ECB, // 加密模式
      padding: CryptoJS.pad.ZeroPadding,
    }
  ).toString();
  const text = CryptoJS.enc.Base64.parse(base).toString(CryptoJS.enc.Hex);
  return text;
}

function getUrl() {
  const userHash = $.getdata($.userHash);
  return `https://napi.ithome.com/api/usersign/sign?userHash=${userHash}&type=0&timestamp=${now}&${gnekk()}=${geKsk()}`;
}

